Описание:
Продается производственная база южнее ТЦ Мега Берёзка. Расположена в центральной части города на земельном участке общей площадью 0,6 Га с собственным действующим железнодорожным тупиком. 
Производственная база состоит из следующих объектов: 
1. Административное здание (2-эт., общей площадью 350 кв.м.);
2. Железнодорожный тупик (220 метров);
3. Гараж с 3-х эт. зданием (общ.пл. 291 кв.м.);
4. Здание (общ.пл. 180 кв.м.);
5. Земельный участок 6144 кв.м.
Теплоснабжение автономное, водоснабжение, водоотведение, электроснабжение централизованное. Удобные подъездные пути и транспортная развязка. Выезд на ул. Железнодорожную через 100 метров от ворот., 14 фото
